import React, { Component } from "react";
import Button from "./components/button/Button";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: "",
    };
  }

  handleChange = ({ target: { value } }) => {
    this.setState({ data: value });
  };

  render() {
    return (
      <div>
        <Button name="Enter"></Button>
      </div>
    );
  }
}
export default App;
